            <img
                src="filler.jpg"
                alt="thumbnail for filler" className="sidebar__thumbnail" />
            <h5 className="sidebar__title">Filler Title</h5>
            <p className="sidebar__creator">Filler Creator</p>
        </section>
    )
}
